import React, { Component } from 'react'

export default class RadioInput extends Component {
    render() {
        return (
            <div>
                <form>
                    <input type="radio" onChange={e=>this.props.handleChange(e)} name="status" checked value="In Stock"/>
                    <label htmlFor="inStock" className='form__label'>In stock</label>
                    <input type="radio" onChange={e=>this.props.handleChange(e)} name="status" value="Out of Stock"/>
                    <label htmlFor="outOfStock" className='form__label'>Out of stock</label>
                </form>
            </div>
        )
    }
}
